const Teams = ({employees}) => {

    const newSet = {};
    const addedTeam = employees.map((employee)=>{
        if(!newSet[employee.teamName]){
            newSet[employee.teamName]=true;
            return true;
        }
    })

    return(
        <>
            <div className="container">
                <div className="row justify-content-center text-center">
                    <ul className="list-group">
                        {
                            addedTeam.map((employee)=>
                                <div>
                                    <li className="list-group-item"
                                        data-bs-toggle="collapse"
                                        data-bs-target={'#'+employee.teamName}
                                    >
                                        {employee.teamName}
                                    </li>
                                    <div className="collapse" id={employee.teamName}>
                                        <div className="card">
                                            <div className="card-body">
                                                {
                                                    employees.map((e)=>
                                                        e.teamName === employee.teamName
                                                        ?   <div>
                                                                <div className="card-title">
                                                                    <h5>Name: {e.fullName}</h5>
                                                                </div>
                                                                <div className="card-text">
                                                                    <h5>Designation: {e.designation}</h5>
                                                                </div>
                                                            </div> : null
                                                    )
                                                }
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            )
                        }
                    </ul>
                </div>
            </div>
        </>
    );
}

export default Teams;
